import React from 'react';
import CrudTable from '../components/CrudTable';
import { consultationApi } from '../services/api';

const fields = [
  { key: 'consultId', label: 'ID', noForm: true },
  { key: 'patientId', label: 'Patient ID', type: 'number' },
  { key: 'doctorId', label: 'Doctor ID', type: 'number' },
  { key: 'consultDate', label: 'Date', type: 'date' },
  { key: 'diagnosis', label: 'Diagnosis', placeholder: 'Doctor diagnosis' },
  { key: 'prescription', label: 'Prescription', placeholder: 'Prescribed medications' },
  { key: 'notes', label: 'Consultation Notes' },
];

export default function Consultations() {
  return (
    <div>
      <h1 style={{ fontFamily: "'DM Serif Display', serif", fontSize: 26, marginBottom: 6 }}>Consultations</h1>
      <p style={{ color: 'var(--text-light)', marginBottom: 24, fontSize: 14 }}>Doctor consultations, diagnoses and prescriptions</p>
      <CrudTable title="Consultations" fields={fields} api={consultationApi} idField="consultId" />
    </div>
  );
}
